import GenreCard from "../../pages/genreCard";

function GenreComponent({ genreData }) {
  
  return (
    <div className='outlined-stats-container'>
      <div className='glassmorphism-test'></div>

      <div className='dashboard-flexbox-container song-component-container'>
        <div className='topArtists-container'>
          <h1>Top Genres</h1>
            <div className='topArtists'>
              {genreData.slice(0, 10).map((genre, index) => (
                <GenreCard
                  key={index}
                  genreName={genre[0]}
                  position={index + 1}
                />
              ))}
            </div>
          </div>
        </div>
      </div>
  );
}

export default GenreComponent;
